        return <div>Loading...</div>;
    }
    console.log('post', posts);

    return (
        <div>
            <h2>{posts.title}</h2>
            <p>{posts.content}</p>
            {/* 기타 게시글 내용을 보여주는 UI 구현 */}
        </div>
    );
};
